<head>
	<meta charset="UTF-8">
	<meta name="viewport" content="width=device-width, initial-scale=1.0">
	<link rel="icon" href="./assets/images/catalyst.png" />
	<link rel="stylesheet" href="./assets/styles/frappe.gantt.css" />
	<link rel="stylesheet" href="./assets/styles/svg.css" />
	<link rel="stylesheet" type="text/css" href="./assets/styles/color.system.css" />
	<link rel="stylesheet" type="text/css" href="./assets/styles/button.css" />
	<link rel="stylesheet" href="./assets/styles/fonts.css" />
	<link rel="stylesheet" href="./assets/styles/fonticons.css" />
	<script src="./assets/scripts/button.js"></script>
	<style>
		body {
			font-family: sans-serif;
			height: 100%;
			margin: 0;
			font-family: ubuntu, -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto,
        Oxygen-Sans, Ubuntu, Cantarell, "Helvetica Neue", sans-serif;
			font-size: 16px;
		}
		.container {
			position: fixed;
			width: 100%;
			margin: 0;
			padding: 0;
			padding-bottom: 0;
		}
		.heading {
			text-align: center;
			margin-top:24px;
		}
		.gantt .startend .bar {
			fill: var(--ribosome-green-bg);
		}
		/* custom class */
		.gantt .develop .bar {
			fill: var(--ribosome-red-bg);
		}
		.gantt .build .bar {
			fill: var(--ribosome-blue-bg);
		}
		.gantt .design .bar {
			fill: var(--ribosome-yellow-bg);
		}
		.gantt .plan .bar {
			fill: var(--ribosome-orange-bg);
		}
		.svg-bg {
			position: fixed;
			top: 0; left: 0;
			width: 100%; height: 100%;
			background-color: rgba(0, 0, 0, 0.9);
			display: none;
		}
		button.fab {
			border-radius: 1.125em;
			width: 1.60em;
			height: 1.60em;
			font-size: 1.40em;
			padding: 0;
			overflow: hidden;
			position: relative;
		}
		.triggers {
      position: absolute;
      cursor: pointer;
    }
    .description {
      position: absolute; left: 0; top: 0;
      left: 0; top: 0; right: 0; bottom: 0;
      padding: 4% 5%;
      background-color:rgba(0, 195, 255, 0.7);
      display: none;
    }
    .box {
      position: relative;
      border-radius: 1.5em;
      border: 2px solid black;
      padding: 2em;
    }
	</style>
	<script src="./assets/scripts/frappe.gantt.js"></script>
</head>
